import Piechart from './Piechart';
import Listtest from './listtest';
import Row from './row';
import './App.css';
class App extends Component {
  constructor(props) {

  super(props);
  this.state = {
    dataset1: ['A','B','C','D','E','A','B','C','D','E','A','B','C','D','E'],
    dataset1: ['A','BB','CC','DD','EE','A','BB','CC','DD','EE','A','BB','CC','DD','EE'],
    dataset1: ['AAA','BBBB','C','DD','EE','AAA','BBBB','C','DD','EE','AAA','BBBB','C','DD','EE'],
    myrect:[]
  }
  this.rowgen=this.rowgen.bind(this);
};
rowgen(){
    var a= this.state.dataset.map((d, i) => (<rect key={i} onClick={() => this.handleClick(d)} className="rec" fill="white" x={i*18} y={0} width='18' height="18" strokeWidth=".1" stroke="black" > </rect>))
    this.setState({ myrect:a })
  }
  render() {
// Destructuring is the process of getting things exactly by their name.
    const { dataset } = this.state;
    return (
      <div className="App">
        <button onClick={this.rowgen}>Rowgen</button>
        <Row dataset="Dataset2" data={this.state.dataset1}/>
        <Row dataset="Dataset2" data={this.state.dataset2}/>
        <Row dataset="Dataset2" data={this.state.dataset3}/>
      </div>
    );
  }
}
export default App;




